import React from "react";
import "./cards.css";
import reactCards from './reactCards';

/* Copy the map part    */
const Cards = (props) => {
  console.log(props.view)
  if (props.view === "React"){ 

    return ( 
      reactCards.map((react) =>(
          <div className="col card-col">
      <div className="card text-center">
        <img className="card-img-top" src=".../gls" alt="Card image cap"/>
        <div className="card-body">
          <h5 className="card-title">{react.class}</h5>
          <p className="card-text"> 
          {react.description}
         </p>
          <a href="#" className="btn btn-outline-success">{`Hours ${react.hours}`}</a>
        </div>
      </div>
        </div>
        )

      )



      )

  }


};

export default Cards;
